import React from 'react'
import './Header.css';

// import logo from "/My project/ca/src/Assets/ca-logo.png";
// import heading from "/My project/ca/src/Assets/cheading.png";


function Header() {
    

    function openNav() {
        document.getElementById("mySidenav").style.width = "250px";
      }
      
      function closeNav() {
        document.getElementById("mySidenav").style.width = "0";
      }

    return (
       
        
        <div>
        <div id="mySidenav" className="sidenav">
        <a href="javascript:void(0)" className="closebtn" onclick={closeNav()}>&times;</a>
        <a href="abt">About</a>
        <a href="ser">Services</a>
        <a href="cli">Clients</a>
        <a href="cont">Contact</a>
        </div>

        <h2>Right-sided Navigation</h2>
        <p>Click on the element below to open the right-sided navigation menu.</p>
        <span style={{fontSize:"30px",cursor:"pointer"}} onclick={openNav()}>&#9776; open</span>
        </div>

    )
};

export default Header;
